import React from 'react';

export default function Bug( {bug, toggleBug} ){

	function handleBugClick() {
		toggleBug(bug.id);
	}
	return (
		<li className="list-group-item">
			<input className="form-check-input me-1" type="checkbox" checked={bug.complete} onChange={handleBugClick} />
			{bug.name}
		</li>
	);
}
